import React from 'react';
const e = React.createElement;

class Button extends React.Component{

    constructor(props){
        super(props)
        this.props.onClick = this.props.onClick.bind(this);
    }

    render(){
        return e('button',{
            onClick:()=>this.props.onClick
        },
        )
    }
}

export default Button;
